import App from '../page_objects/app'
import Base from '../page_objects/base'

describe('Test Suite - Quick Quote Happy Path', () => {
    it('Load Homepage', () => {
        App.loadHomepage()
        //browser.url('http://www.bymiles.co.uk')
       // browser.pause(3000)
        Base.pauseShort()
    })

    it('Accept Cookies', () => {
        const cCookies = $('#cookie-consent > a > span')
        cCookies.waitForExist()
        cCookies.click()

    })

    it('Enter Registration plate number and Click Get a Quick Quote', () => {
        // enter the registration plate number
        const cRegistration = $ ('#__next > div > div.page-wrapper > div.hero-wrapper > div.image-wrapper.false > div.content-wrapper > div.reg-to-qq.center.undefined > div > form > input')
        cRegistration.setValue('LM66 YBH')
        browser.pause(3000)

        // click Get a Quick Code button
        const cQuoteButton = $ ('#__next > div > div.page-wrapper > div.hero-wrapper > div.image-wrapper.false > div.content-wrapper > div.reg-to-qq.center.undefined > div > form > button')
        cQuoteButton.click()
        browser.pause(2000)

        // assert
        const cH4 = $ ('#quick-quote > div > div.formbox.formbox--quick-quote-mileage > div.formbox__estimated-mileage-wrapper > div > h4')
        cH4.waitForExist()
        expect(cH4).toHaveTextContaining('LAST YEAR WE THINK YOUR CAR TRAVELLED')
        browser.pause(3000)

     })

    it('Click No Button', () => {
        // click 'no,change estimate' button
        const cNoButton = $('#quick-quote > div > div.formbox.formbox--quick-quote-mileage > div.formbox__estimated-mileage-cta-wrapper > div.formbox__estimated-mileage-cta-change > p')
        cNoButton.click()
        browser.pause(2000)

        // assert
        const cOtherEstimate = $('#quick-quote > div > div.formbox.formbox--quick-quote-mileage > div.formbox__estimated-mileage-wrapper > div > h4')
        cOtherEstimate.waitForExist()
        expect(cOtherEstimate).toHaveTextContaining('THIS YEAR ILL DRIVE ROUGHLY')
      //  expect(cOtherEstimate).toHaveTextContaining('LAST YEAR WE THINK YOUR CAR TRAVELLED')

        browser.pause(3000)
    })

        it('Enter other estimate', () => {
        const cEstField = $ ('#edit-mileage')
        cEstField.waitForExist()
        cEstField.setValue('5000')

        const cContinueButton = $('#quick-quote > div > div.formbox.formbox--quick-quote-mileage > div.formbox__estimated-mileage-cta-wrapper > div')
        cContinueButton.click()

        const cQuestion = $('#quick-quote-form > div:nth-child(1) > p.form__question')
        cQuestion.waitForExist()
        expect(cQuestion).toHaveTextContaining('How many years of No Claims Discount do you have?')

    })

    it('Enter Personal Details', () => {
        // select No Claims Discount years
        const cNoClaims = $('#quick-quote-form > div:nth-child(1) > div.form-element > div')
        cNoClaims.click()
        const cOptions = $ ('#react-select-ncd--option-1') 
        cOptions.click()

        // enter Age
        const cAge = $('#age > input')
        cAge.setValue('32')
        browser.pause(3000)

        // enter postcode
        const cPostCode = $('#postcode > input')
        cPostCode.setValue('SW11 5BH')
        browser.pause(3000)

        // select car insurance renew
        const cRenew = $('#quick-quote-form > div:nth-child(1) > div:nth-child(7) > div')
        cRenew.click()
        const cOptions1 = $ ('#react-select-renewal_month--option-1')
        cOptions1.click()
        browser.pause(3000)

    })

    it('Prove - drag and drop', () => {
        // park the car
        const cDragText = $('#quick-quote-form > div:nth-child(2) > div > div.text')
        cDragText.waitForClickable()
        cDragText.doubleClick()

        expect(cDragText).toHaveTextContaining('PARKED!')
        console.log('Kseniya test completed..')
        browser.pause(4000)

    })

    it('Click Get a Quick Quote', () => {
        const cQuoteButton = $('#quick-quote-form > button > span')
        cQuoteButton.click()
        browser.pause(2000)

    })

    it('The estimate', () => {
        // assert the estmate amount is displayed
        const cAnnualEstimate = $('#annual-estimate > div.mileage-estimator-wrapper > div.estimated-price-wrapper > div > h2')
        cAnnualEstimate.waitForExist()
        expect(cAnnualEstimate).toHaveTextContaining('Your annual estimate is:')
        browser.pause(3000)

    })

})

